import React from "react";

const Customer = () => {
  return (
    <>
    <form>
      <label>Customer ID : </label>
      <input type="text" className="border-2 border-gray-600  mt-8 ml-16"  /><br />

      <label>Name : </label>
      <input type="text" className="border-2 border-gray-600  mt-8 ml-28"  /><br />

      <label>Relation : </label>
      <input type="text" className="border-2 border-gray-600  mt-8 ml-24"  /><br />

      <label>Nominee : </label>
      <input type="text" className="border-2 border-gray-600  mt-8 ml-20"  /><br />

      <label>Land Mark : </label>
      <input type="text" className="border-2 border-gray-600  mt-8 ml-16"  /><br />

      <label>Pincode : </label>
      <input type="text" className="border-2 border-gray-600  mt-8 ml-16"  /><br />

      <label>City : </label>
      <input type="text" className="border-2 border-gray-600  mt-8 ml-28"  /><br />

    </form>
    </>
  );
};

export default Customer;
